-- ----------------------------
-- Table structure for osa_attendance
-- ----------------------------
DROP TABLE IF EXISTS `osa_attendance`;
CREATE TABLE `osa_attendance` (
  `att_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '记录id',
  `att_number` int(11) DEFAULT NULL COMMENT '员工编码',
  `att_username` varchar(255) DEFAULT NULL COMMENT '员工姓名',
  `att_times` int(11) DEFAULT NULL COMMENT '时间',
  `att_sign_in` varchar(255) DEFAULT NULL COMMENT '签到时间',
  `att_sign_out` varchar(255) DEFAULT NULL COMMENT '签退时间',
  `att_late_times` varchar(255) DEFAULT NULL COMMENT '迟到时间',
  `att_early_retreat` varchar(255) DEFAULT NULL COMMENT '早退时间',
  `att_department_name` varchar(255) DEFAULT NULL COMMENT '部门名称',
  `att_peacetime` char(11) DEFAULT NULL COMMENT '平时',
  `att_weekend` char(11) DEFAULT NULL COMMENT '周末',
  `att_import_time` int(11) DEFAULT NULL COMMENT '考勤表对应的时间',
  `att_create_time` int(11) DEFAULT NULL COMMENT '数据创建时间',
  PRIMARY KEY (`att_id`)
) ENGINE=MyISAM AUTO_INCREMENT=61624 DEFAULT CHARSET=utf8;

