-- Table structure for osa_department
-- ----------------------------
DROP TABLE IF EXISTS `osa_department`;
CREATE TABLE `osa_department` (
  `department_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '部门id',
  `department_level` int(11) DEFAULT NULL COMMENT '部门等级，默认3级     1  1级  2 2级  3 3级   以此类推',
  `department_name` varchar(255) DEFAULT NULL COMMENT '部门名称',
  `department_superiorid` int(11) DEFAULT NULL COMMENT '上级id（一级部门的上级id为0）',
  `department_boss` varchar(255) DEFAULT NULL COMMENT '部门负责人',
  `department_size` int(11) DEFAULT NULL COMMENT '部门人数',
  PRIMARY KEY (`department_id`)
) ENGINE=MyISAM AUTO_INCREMENT=97 DEFAULT CHARSET=utf8;

