DROP TABLE IF EXISTS `osa_employee`;
CREATE TABLE `osa_employee` (
  `em_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '员工id',
  `em_username` varchar(255) DEFAULT NULL COMMENT '员工名称',
  `em_worknumber` int(11) DEFAULT NULL COMMENT '工号 ',
  `em_workstatus` int(11) DEFAULT NULL COMMENT '工作状态  1试用期 2实习 3正式 4离职',
  `em_company` varchar(255) DEFAULT NULL COMMENT '所属公司',
  `em_duties` varchar(255) DEFAULT NULL COMMENT '职务',
  `em_firstleader` varchar(255) DEFAULT NULL COMMENT '直属领导',
  `em_createtime` int(11) DEFAULT NULL COMMENT '入职时间',
  `em_formaltime` int(11) DEFAULT NULL COMMENT '转正时间',
  `em_workage` int(11) DEFAULT NULL COMMENT '入职时间（单位 月）  司龄',
  `em_endtime` int(11) DEFAULT NULL COMMENT '合同到期时间',
  `em_renew` int(11) DEFAULT NULL COMMENT '续签次数',
  `em_department_id` int(11) DEFAULT NULL COMMENT '部门id',
  `em_idcard` char(18) DEFAULT NULL COMMENT '身份证卡号',
  `em_sex` int(11) DEFAULT NULL COMMENT '性别 1男 2 女',
  `em_birthday` int(11) DEFAULT NULL COMMENT '出生年月',
  `em_age` int(255) DEFAULT NULL COMMENT '年龄',
  `em_register_place` varchar(255) DEFAULT NULL COMMENT '户口所在地',
  `em_registerplace_type` varchar(255) DEFAULT NULL COMMENT '户口类型 1城镇 2 农村',
  `em_province` varchar(255) DEFAULT NULL COMMENT '籍贯',
  `em_nation` varchar(255) DEFAULT NULL COMMENT '民族',
  `em_banknumber` char(19) DEFAULT NULL COMMENT '银行卡号',
  `em_bankname` varchar(255) DEFAULT NULL COMMENT '银行名称',
  `em_mobile` char(11) DEFAULT NULL COMMENT '手机号码',
  `em_email` varchar(255) DEFAULT NULL COMMENT '邮箱地址',
  `em_wxnumber` varchar(255) DEFAULT NULL COMMENT '微信号',
  `em_graduateschool` varchar(255) DEFAULT NULL COMMENT '毕业学校',
  `em_graduatetime` int(11) DEFAULT NULL COMMENT '毕业时间',
  `em_major` varchar(255) DEFAULT NULL COMMENT '专业',
  `em_degreeofeducation` varchar(255) DEFAULT NULL COMMENT '文化程度',
  `em_professional_title` varchar(255) DEFAULT NULL COMMENT '专业职称',
  `em_qualificationCertificate` varchar(255) DEFAULT NULL COMMENT '资格证书',
  `em_political_face` varchar(255) DEFAULT NULL COMMENT '政治面孔',
  `em_marital_status` int(255) DEFAULT NULL COMMENT '婚姻状况  1未婚 2已婚 3离异 4丧偶',
  `em_reproductive_status` int(11) DEFAULT NULL COMMENT '生育状况  1已育  2 未育',
  `em_baby_birthday` int(11) DEFAULT NULL COMMENT '孩子出生年月',
  `em_addressnow` varchar(255) DEFAULT NULL COMMENT '现居住地',
  `em_register_time` int(11) NOT NULL COMMENT '录入时间',
  `em_workplace` varchar(255) DEFAULT NULL COMMENT '工作地区',
  `em_kingdee` varchar(255) DEFAULT NULL COMMENT '金蝶核算口径（薪资）',
  `em_kingdeedepartment` varchar(255) DEFAULT NULL COMMENT '岗位费用金蝶归属部门',
  `em_computersubsidy` decimal(11,4) DEFAULT NULL COMMENT '电脑补助',
  `em_skillsubsidy` decimal(11,4) DEFAULT NULL COMMENT '技术补助',
  `em_basewage` decimal(11,4) DEFAULT NULL COMMENT '基本工资',
  `em_standard_performance_wage` decimal(11,4) DEFAULT NULL COMMENT '标准绩效工资',
  `em_wageascription` varchar(255) DEFAULT NULL COMMENT '薪资归属',
  `em_telsubsidy` decimal(11,4) DEFAULT NULL COMMENT '通讯补助',
  `em_tracfficsidy` decimal(11,4) DEFAULT NULL COMMENT '交通补助',
  `em_wage` decimal(11,4) DEFAULT NULL COMMENT '工资',
  `em_positionwage` decimal(11,4) DEFAULT NULL COMMENT '职位工资',
  `em_remove_social_insurance_payment_last` int(11) DEFAULT NULL COMMENT '社保最后缴纳日期',
  `em_remove_accumulation_fund_payment_last` int(11) DEFAULT NULL COMMENT '公积金最后缴纳日期',
  `em_remove_worktime_last` int(11) DEFAULT NULL COMMENT '最后工作日期',
  `em_department_first` int(11) DEFAULT NULL COMMENT '一级部门id',
  `em_department_second` int(11) DEFAULT NULL COMMENT '二级部门id',
  `em_department_third` int(11) DEFAULT NULL COMMENT '三级部门id',
  PRIMARY KEY (`em_id`,`em_register_time`)
) ENGINE=MyISAM AUTO_INCREMENT=255 DEFAULT CHARSET=utf8;

